def model_score(state: ImmutableState) -> float:
    features = extract_features(state, hyperparams)
    with torch.no_grad():
        features_tensor = torch.tensor(features, dtype=torch.float32).unsqueeze(0).to(device)
        score = model(features_tensor).item()
    return score


def minimax(state: ImmutableState, depth: int, alpha: float, beta: float, maximizing_player: bool, player: int) -> float:
    if is_terminal(state):
        return terminal_utility(state)
    if depth == 0:
        return model_score(state)

    actions = get_all_valid_actions(state)  
    if maximizing_player:
        max_eval = float("-inf")
        actions.sort(key=lambda a: -model_score(change_state(state, a)))
        for action in actions:
            new_state = change_state(state, action)
            eval = minimax(new_state, depth - 1, alpha, beta, False, player)
            max_eval = max(max_eval, eval)
            alpha = max(alpha, eval)
            if beta <= alpha:
                break
        return max_eval
    else:
        min_eval = float("inf")
        actions.sort(key=lambda a: model_score(change_state(state, a)))
        for action in actions:
            new_state = change_state(state, action)
            eval = minimax(new_state, depth - 1, alpha, beta, True, player)
            min_eval = min(min_eval, eval)
            beta = min(beta, eval)
            if beta <= alpha:
                break
        return min_eval
    